import React, { Component } from "react";
import "./bloodbank.css";

class Bloodbank0Card extends Component {
  render() {
    return (
      <div className="card">
        <table className="card-table table">
          <tbody></tbody>
        </table>
        <tr>
          <td>FFP 0 Rh P(0+): {this.props.ffp_0pos}</td>
          <td>FFP 0 Rh N(0-): {this.props.ffp_0neg}</td>
          <td>PC 0 Rh P(0+): {this.props.pc_0pos}</td>
          <td>PC 0 Rh N(0-): {this.props.pc_0neg}</td>
        </tr>
      </div>
    );
  }
}

export default Bloodbank0Card;
